import { CREATE_POST, UPDATE_LIKE } from '../types';

const initialState = {
  posts: [
    {
      id: 12345,
      avatar:
        'data:image/jpeg;base64,',
      name: 'Harry Potter',
      nickname: '@The_boy_who_liveD',
      postText: "Different morning - same situation...",
      imageLink: 'https://ahseeit.com//king-include/uploads/2018/12/fb_img_1544699827399-8122187269.jpg',
      date: '30/10/2002',
      likes: 25600000,
      liked: false,
    },
    {
        id: 32154,
        avatar:
          'data:image/jpeg;base64,',
        name: 'Bilbo Baggins',
        nickname: '@breakfast_enjoyer',
        postText: "LOL, it`s actually how it was",
        imageLink: 'https://i.redd.it/2k3aj94q59511.jpg',
        date: '22/09/3001',
        likes: 125335,
        liked: false,
      },
  ],
};

export const postsReducer = (state = initialState, action) => {
  switch (action.type) {
    case CREATE_POST:
      return {
        ...state,
        posts: [...state.posts, action.payload],
      };
    case UPDATE_LIKE:
      return {
        ...state,
        posts: state.posts.map((post) => {
          if (action.id === post.id) {
            const newPost = Object.assign({}, post);
            if (newPost.liked) {
              newPost.liked = false;
              newPost.likes--;
            } else {
              newPost.liked = true;
              newPost.likes++;
            }
            return newPost;
          }
          return post;
        }),
      };
    default:
      return state;
  }
};